INSERT INTO `cms_news` VALUES ('1173532154935132160', '测试资讯三', '测试描述', '/fingertip/userfiles/fileupload/202005/1263851275422560257.png', '0', NULL, '<!--HTML--><ul style=\"box-sizing: border-box; margin-bottom: 10px; color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\" class=\" list-paddingleft-2\"><li><p>Global：全局配置类，全局常量，读取属性文件参数值等</p></li><li><p>EncodeUtils：封装各种格式的编码解码工具类，HEX、Base64、HTML、URL、XSS过滤、SQL过滤等</p></li><li><p>ListUtils：List常用工具类，继承Apache的ListUtils，New工具、快速提取属性值、类型转换等</p></li><li><p>MapUtils：Map常用工具类，继承Apache的MapUtils，New工具、Map与Bean互转等</p></li><li><p>SetUtils：Set常用工具类，继承Apache的SetUtils，New工具等</p></li><li><p>IdGenerate：封装各种生成唯一性ID算法的工具类，生成LongUUID，StringUUID，Code生成等</p></li><li><p>ByteUtils：字节转换工具</p></li><li><p>DateUtils：日期工具类，继承Apache的DateUtils</p></li><li><p>NumberUtils：BigDecimal工具类，继承Apache的NumberUtils类</p></li><li><p>ObjectUtils：对象操作工具类，继承Apache的ObjectUtils类</p></li><li><p>StringUtils：字符串工具类，继承Apache的StringUtils类</p></li><li><p>TimeUtils：时间计算工具类，xx天xx时xx分xx秒，刚刚，xx秒，xx分钟，xx小时前、xx天前</p></li><li><p>WorkDayUtils：工作日计算工具类，计算日期直接的工作日等</p></li><li><p>BeanMapper：简单封装Dozer，对象数据映射</p></li><li><p>JaxbMapper：Jaxb实现XML与Java Object的转换</p></li><li><p>JsonMapper：简单封装Jackson，实现Json与Java Object的转换</p></li><li><p>ClassUtils：Class扫描工具类，根据接口查询类，根据继承查询类等</p></li><li><p>ReflectUtils：反射工具类，方便进行getter/setter方法, 访问私有变量, 调用私有方法</p></li><li><p>ModuleUtils：模块工具类，方便获取系统模块信息，例如 ${@ModuleUtils.getModule(‘core’)}</p></li><li><p>DictUtils：字典工具类，例如 ${@DictUtils.getDictListJson(‘sys_menu_type’)}</p></li><li><p><strong style=\"box-sizing: border-box;\">UserUtils：用户工具类，方便获取进行用户及相关信息，例如 ${@UserUtils.getUser()}</strong></p></li><li><p>EmpUtils：员工工具类，获取当前用户员工信息、所在部门、公司，${@EmpUtils.getEmployee()}</p></li><li><p>RoleUtils：角色工具类，判断当前或某用户是否包含某角色，${@RoleUtils.hasUserRole(‘user’,’role’)}</p></li></ul><p><br/></p>', 'system', '1', '2020-04-10 12:20:13', '0', 'frontEnd_jrv1', '2019-09-16 17:40:44', 'system', '2020-05-23 11:37:11', '');
INSERT INTO `cms_news` VALUES ('1264037779580542976', '测试', '111111', '/fingertip/userfiles/fileupload/202005/1266949950616956930.jpg', '1', NULL, '<!--HTML--><p style=\"margin: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">新京报讯（记者 郭铁）乳业横跨一二三产业链条，受疫情冲击较为明显。如何推动疫情后乳业高质量发展，全国人大代表、蒙牛研发创新部员工史玉东建议，通过加快发展乳酪产业、鼓励企业生产经营浓缩乳、提升乳品深加工水平等措施，开拓乳品消费新领域，完善乳业“蓄水池”效应。</span></p><p><img class=\"large\" data-loadfunc=\"0\" src=\"/fingertip/userfiles/frontEnd_ujrq/images/20200523/1590207509005044107.png\" data-loaded=\"0\" style=\"border: 0px; width: 600px; display: block;\"/></p><p style=\"margin: 26px 0px 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\"><span class=\"bjh-strong\" style=\"font-size: 18px; font-weight: 700;\">发展深加工解决配料进口依赖</span></span></p><p style=\"margin: 22px 0px 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">受疫情影响，我国乳业上游奶牛养殖业收入下降30%，中小牧场资金回流困难，乳业下游销量下滑。2月以来，下游乳企为稳定上游养殖大量喷粉，消化多余原奶，行业日均喷粉奶量最高时达1.8万吨/日。而在境外疫情大暴发后，尤其是欧盟、美国、澳大利亚、新西兰等主要产奶国家和地区受到疫情影响，使得对原料进口依赖度较高的我国婴幼儿配方粉行业受到严峻挑战。</span></p><p style=\"margin: 22px 0px 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">史玉东认为，此次疫情凸显出中国乳业长期存在的几方面问题：产业布局不平衡，“北奶南运、北奶西运”的格局长期存在；疫情带来的全球停产停工造成苜蓿、大豆等饲料、饲草出口国运输困难、成本上升；婴幼儿配方乳粉主要生产原料乳清粉和乳铁蛋白、乳糖等配料严重依赖进口，疫情影响下成本进一步上升；产业缺乏应急体系。</span></p><p style=\"margin: 22px 0px 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">针对上述问题，史玉东建议，鼓励企业做大做强本土奶酪产业。无论应对疫情等突发事件，还是解决我国产奶旺季、消费淡季的供需矛盾，奶酪产业都可以作为“蓄水池”，缓解原料奶过剩问题；通过支持鼓励企业生产经营浓缩乳，并允许其作为主要乳原料在调制乳和发酵乳等产品中使用；发展乳品深加工，提升产业附加值，不仅能够获得乳铁蛋白、乳糖等婴配粉生产配料，解决婴配粉配料严重依赖进口的局面，促进乳业创新升级发展。</span></p><p style=\"margin: 22px 0px 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\"></span></p><p><img class=\"large\" data-loadfunc=\"0\" src=\"/fingertip/userfiles/frontEnd_ujrq/images/20200523/1590207620208022089.jpg\" data-loaded=\"0\" style=\"border: 0px; width: 600px; display: block;\"/></p><p style=\"margin: 26px 0px 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">图/图虫创意</span></p><p style=\"margin: 22px 0px 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\"><br/></span><br/></p><p style=\"margin: 22px 0px 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\"><span class=\"bjh-strong\" style=\"font-size: 18px; font-weight: 700;\">加快保健食品审批</span></span></p><p style=\"margin: 22px 0px 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">疫情期间，免疫力话题受到关注。国家卫健委发布《新型冠状病毒感染的肺炎防治营养膳食指导》，鼓励人群多摄入奶类产品，特别是含有益生菌的酸奶。在此背景下，蒙牛“健字号”认证的益生菌酸奶销售大幅增长。但据史玉东了解，目前市场上益生菌乳制品众多，品质良莠不齐，消费者难以辨别真正有效的产品。而国家保健食品审批流程过长，基本需要5年左右。</span></p><p style=\"margin: 22px 0px 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">史玉东建议，加快保健食品审批，特别是益生菌、益生元等提升免疫力类的产品。合理调整我国保健品管理模式，给消费者更多的自主选择权，加快企业的功能食品上市，从而多方面促进乳业高质量发展。</span></p><p style=\"margin: 22px 0px 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">新京报记者 郭铁 图片来源 受访者供图</span></p><p style=\"margin: 22px 0px 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">编辑 李严 校对 何燕</span></p><p><br/></p>', 'frontEnd_ujrq', '1', '2020-05-23 12:20:23', '0', 'frontEnd_ujrq', '2020-05-23 11:37:46', 'frontEnd_ujrq', '2020-05-31 12:29:45', NULL);
