INSERT INTO `js_sys_config` VALUES ('1247514479615684608', '账号自助-允许自助注册的用户类型', 'sys.account.registerUser.userTypes', 'member', '0', 'system', '2020-04-07 21:20:04', 'system', '2020-04-07 21:20:04', '允许注册的用户类型（多个用逗号隔开，例如：employee,member）');
INSERT INTO `js_sys_config` VALUES ('1247514479875731456', '账号自助-验证码有效时间（分钟）', 'sys.account.validCodeTimeout', '10', '0', 'system', '2020-04-07 21:20:04', 'system', '2020-04-07 21:20:04', '找回密码时，短信/邮件验证码有效时间（单位：分钟，0表示不限制）');
INSERT INTO `js_sys_config` VALUES ('1247514480098029568', '用户管理-账号默认角色-员工类型', 'sys.user.defaultRoleCodes.employee', 'default', '0', 'system', '2020-04-07 21:20:04', 'system', '2020-04-07 21:20:04', '所有员工用户都拥有的角色权限（适用于菜单授权查询）');
INSERT INTO `js_sys_config` VALUES ('1247514480374853632', '用户管理-账号初始密码', 'sys.user.initPassword', '123456', '0', 'system', '2020-04-07 21:20:04', 'system', '2020-04-07 21:20:04', '创建用户和重置密码的时候用户的密码');
INSERT INTO `js_sys_config` VALUES ('1247514480882364416', '用户管理-初始密码修改策略', 'sys.user.initPasswordModify', '1', '0', 'system', '2020-04-07 21:20:05', 'system', '2020-04-07 21:20:05', '0：初始密码修改策略关闭，没有任何提示；1：提醒用户，如果未修改初始密码，则在登录时和点击菜单就会提醒修改密码对话框；2：强制实行初始密码修改，登录后若不修改密码则不能进行系统操作');
INSERT INTO `js_sys_config` VALUES ('1247514481096273920', '用户管理-账号密码修改策略', 'sys.user.passwordModify', '1', '0', 'system', '2020-04-07 21:20:05', 'system', '2020-04-07 21:20:05', '0：密码修改策略关闭，没有任何提示；1：提醒用户，如果未修改初始密码，则在登录时和点击菜单就会提醒修改密码对话框；2：强制实行初始密码修改，登录后若不修改密码则不能进行系统操作。');
INSERT INTO `js_sys_config` VALUES ('1247514481268240384', '用户管理-账号密码修改策略验证周期', 'sys.user.passwordModifyCycle', '30', '0', 'system', '2020-04-07 21:20:05', 'system', '2020-04-07 21:20:05', '密码安全修改周期是指定时间内提醒或必须修改密码（例如设置30天）的验证时间（天），超过这个时间登录系统时需，提醒用户修改密码或强制修改密码才能继续使用系统。单位：天，如果设置30天，则第31天开始强制修改密码');
INSERT INTO `js_sys_config` VALUES ('1247514481431818240', '用户管理-密码修改多少次内不允许重复', 'sys.user.passwordModifyNotRepeatNum', '1', '0', 'system', '2020-04-07 21:20:05', 'system', '2020-04-07 21:20:05', '默认1次，表示不能与上次密码重复；若设置为3，表示并与前3次密码重复');
INSERT INTO `js_sys_config` VALUES ('1247514481603784704', '用户管理-账号密码修改最低安全等级', 'sys.user.passwordModifySecurityLevel', '0', '0', 'system', '2020-04-07 21:20:05', 'system', '2020-04-07 21:20:05', '0：不限制等级（用户在修改密码的时候不进行等级验证）\r；1：限制最低等级为很弱\r；2：限制最低等级为弱\r；3：限制最低等级为安全\r；4：限制最低等级为很安全');
