INSERT INTO `syb_invest_org` VALUES ('1252137314141679616', '深创投', '/fingertip/userfiles/fileupload/202004/1252137308219322370.png', '2020-04-20 15:27:00', '370202', '阅江中路832号保利天幕广场1606', '深圳市创新投资集团有限公司（简称“深创投”）1999年由深圳市政府出资并引导社会资本出资设立，公司以发现并成就伟大企业为使命，致力于做创新价值的发掘者和培育者，已发展成为以创业投资为核心的综合性投资集团，现注册资本54.2亿元，管理各类资金总规模约3464.4亿元。', '<!--HTML--><p style=\"margin: 0cm 0cm 0.0001pt; padding: 0px; list-style: none; color: rgb(102, 102, 102); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; white-space: normal; background-color: rgb(246, 246, 246); text-indent: 34px;\"><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">深圳市创新投资集团有限公司（简称“深创投”）</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">1999</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">年由深圳市政府出资并引导社会资本出资设立，公司以发现并成就伟大企业为使命，致力于做创新价值的发掘者和培育者，已发展成为以创业投资为核心的综合性投资集团，现注册资本</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">54.2</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">亿元，管理各类资金总规模约</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">3464.4</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">亿元。<br style=\"margin: 0px; padding: 0px; list-style: none;\"/><br style=\"margin: 0px; padding: 0px; list-style: none;\"/></span></p><p><span style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(102, 102, 102); font-family: &quot;Microsoft YaHei&quot;; font-size: 10.5pt; background-color: rgb(246, 246, 246);\"></span></p><p style=\"margin: 0cm 0cm 0.0001pt; padding: 0px; list-style: none; color: rgb(102, 102, 102); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; white-space: normal; background-color: rgb(246, 246, 246); text-indent: 34px;\"><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">深创投目前管理基金包括：&nbsp;</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">129</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">只私募股权基金（</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">121</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">只控股管理的基金、</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">8</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">只参股管理的基金），</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">14</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">只股权投资母基金</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">,15</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">只专项基金（不动产基金、定增基金、</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">PPP</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">基金等），同时，集团下设国内首家创投系公募基金管理公司——红土创新基金管理有限公司。围绕创投主业，深创投不断拓展创投产业链，专业化、多元化、国际化业务迅猛推进。<br style=\"margin: 0px; padding: 0px; list-style: none;\"/><br style=\"margin: 0px; padding: 0px; list-style: none;\"/></span></p><p><span style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(102, 102, 102); font-family: &quot;Microsoft YaHei&quot;; font-size: 10.5pt; background-color: rgb(246, 246, 246);\"></span></p><p style=\"margin: 0cm 0cm 0.0001pt; padding: 0px; list-style: none; color: rgb(102, 102, 102); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; white-space: normal; background-color: rgb(246, 246, 246); text-indent: 34px;\"><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">创投业务板块，深创投主要投资中小企业、自主创新高新技术企业和新兴产业企业，涵盖信息科技、互联网</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">/</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">新媒体</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">/</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">文化创意、生物技术</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">/</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">健康、新能源</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">/</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">节能环保、新材料</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">/</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">化工、高端装备制造、消费品</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">/</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">现代服务等行业领域，覆盖企业全生命周期。公司坚持“三分投资、七分服务”理念，通过资源整合、资本运作、监督规范、培训辅导等多种方式助推投资企业快速健康发展。<br style=\"margin: 0px; padding: 0px; list-style: none;\"/><br style=\"margin: 0px; padding: 0px; list-style: none;\"/></span></p><p><span style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(102, 102, 102); font-family: &quot;Microsoft YaHei&quot;; font-size: 10.5pt; background-color: rgb(246, 246, 246);\"></span></p><p style=\"margin: 0cm 0cm 0.0001pt; padding: 0px; list-style: none; color: rgb(102, 102, 102); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; white-space: normal; background-color: rgb(246, 246, 246); text-indent: 34px;\"><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">截至</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">2020</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">年</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">2</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">月底，深创投投资企业数量、投资企业上市数量均居国内创投行业第一位：已投资项目</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">1082</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">个，累计投资金额约</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">493</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">亿元，其中</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">160</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">家投资企业分别在全球</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">16</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">个资本市场上市，</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">263</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">个项目已退出（含</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">IPO</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">）。专业的投资和深度的服务，助推了潍柴动力、酷狗音乐（腾讯音乐）、睿创微纳、西部超导、迈瑞医疗、中新赛克、光峰科技、微芯生物、斗鱼直播、信维通信、宁德时代、环球易购（跨境通）、多氟多、柔宇科技、康方生物、盛瑞传动、星环科技、越疆科技、杰普特等众多明星企业成长，也成就了深创投优异的业绩。<br style=\"margin: 0px; padding: 0px; list-style: none;\"/><br style=\"margin: 0px; padding: 0px; list-style: none;\"/></span></p><p><span style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(102, 102, 102); font-family: &quot;Microsoft YaHei&quot;; font-size: 10.5pt; background-color: rgb(246, 246, 246);\"></span></p><p style=\"margin: 0cm 0cm 0.0001pt; padding: 0px; list-style: none; color: rgb(102, 102, 102); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; white-space: normal; background-color: rgb(246, 246, 246); text-indent: 34px;\"><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">凭借在创投领域的杰出表现，深创投在中国创投委、清科集团、投中集团等权威机构举办的创投机构综合排名中连续多年名列前茅。近十年，在清科“中国创业投资机构</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">50</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">强”年度评选中，深创投五次（</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">2008</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">、</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">2009</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">、</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">2010</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">、</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">2011</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">、</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">2017</span><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 10.5pt;\">年度）荣获内外资创投机构综合排名第一名。</span></p><p><br/></p>', '1', '3', '2', '0', 'system', '2020-04-20 15:29:34', 'system', '2020-04-20 16:00:55', NULL, '0', 'JeeSite');
